import React from 'react';
import './AnimatedText.css';
import Button from 'react-bootstrap/Button';

const AnimatedText = () => {
  return (
    <div className="animated-container">
      <h1 className="typing-effect"> Hi there! <br/>I'm Tharushika Navodi</h1>
      <Button className='button' variant="outline-light">Light</Button>
    </div>
  );
};

export default AnimatedText;
